custom_steps:
WHEN I execute query with variables:
`fragment Seed on BracketSeed {
  id
  type
  stats {
    ... on Person {
      id
      primaryNumber
      primaryPosition {
        abbreviation
      }
      initLastName
      team {
        id
        name
        teamName
      }
    }
    ... on Team {
      id
      teamName
      name
      fileCode
      teamName
      record {
        xWinLoss {
          wins
          losses
        }
      }
      abbreviation
    }
    ... on ByeSeed {
      __typename
      type
      name
    }
  }
  mediaItems {
    key
    altText
    file {
      contentType
      fileName
      url
      height
      width
    }
    tags
    title
  }
  copyItems {
    key
    tags
    value
  }
  entryImage {
    key
    altText
    tags
    title
  }
  mediaSlug
  region
  score @skip(if: $isOpen)
  seedNumber
}

query GetBracket($slug: String!, $locale: Language, $isOpen: Boolean!) {
  getBracket(slug: $slug, locale: $locale, isOpen: $isOpen) {
    id
    activeRound
    appState
    bracketState
    contestId
    copyItems {
      key
      tags
      value
    }
    emailTemplateCode
    gameId
    mediaItems {
      key
      altText
      file {
        contentType
        fileName
        url
        height
        width
      }
      tags
      title
    }
    mediaTopicSlug
    minimumAge
    newsletterSourceId
    pageTitle
    rounds {
      id
      matchups {
        id
        region
        topSeed {
          ...Seed
        }
        bottomSeed {
          ...Seed
        }
        type
        winner @skip(if: $isOpen)
      }
    }
    shareImage {
      key
      altText
      tags
      title
    }
    slug
    sponsorColor
    template
    title
    type
    useAds
    winner @skip(if: $isOpen) {
      ...Seed
    }
  }
}`
with the following variables:
`{
  "slug": "food-fight-2021", // "home-run-derby" | "food-fight-2021"
  "locale": "ES_US", // "ES_US"
  "isOpen": false, // true
}`

